// projetos-lista.js
import React from 'react';
import './projetos-lista.css';
import Lista from '../lista-projetos/lista';
import NavegacaoProjetos from '../navegacaoProjetos/nagacaoProjetos';

function ProjetosLista() {
    return (
        <div className="projetos-container">
            <h2 className="subtitulo-resumo">Meus projetos</h2>
            <NavegacaoProjetos />
            <div className="projetos-lista">
                <div className="projeto">
                    <Lista />
                </div>
            </div>
        </div>
    );
}

export default ProjetosLista;
